import React from 'react';
import Card from './Card';
import Sdata from './Sdata';

//console.log(Sdata[0].sname);

const App = () => ( 
<>
<h1 className="heading_style">List of top 5 Netflix series in 2020</h1>
    
{Sdata.map((val,index) => {
    console.log(index);
    return(
            <Card   
                imgsrc ={val.imgsrc}
                title ={val.title}
                sname = {val.sname}
                link={val.link}/>
    )
})}

</>

    
);
